from typing import List


class Solution:
    def findMaxAverage(self, nums: List[int], k: int) -> float:
        l, r = 0, k
        res = -10000
        while r < len(nums)+1:
            sums = 0
            for i in range(l, r, 1):
                sums += nums[i]

            res = max(res, sums/k)
            r += 1
            l += 1
        return res


